import React from 'react';

import { Container, FormContainer, LoginForm } from './styles';

function Login() {
  return (
      <Container>
          <FormContainer>
              <LoginForm>
                <div className="form-group" >
                    <label htmlFor="login-login" >Login</label>
                    <input id="login-login" placeholder="Login"/>
                </div>
                <div className="form-group" >
                    <label htmlFor="login-password" >Senha</label>
                    <input id="login-password" placeholder="Senha"/>
                </div>
                <button type="button">Entrar</button>
              </LoginForm>
              <a href="">NÃ£o tem uma conta? Cadastre-se</a>
          </FormContainer>
      </Container>
  )
}

export default Login;
